  'shop.aquaventure-bundle-description': '–ü–æ–≥—Ä—É–∑–∏—Ç–µ—Å—å –≤ –ê–∫–≤–∞–ø—Ä–∏–∫–ª—é—á–µ–Ω–∏–µ! –≠—Ç–æ—Ç –Ω–∞–±–æ—Ä —Å –∞–≤–∞—Ç–∞—Ä–æ–º —Å–∫–∞–Ω–µ—Ä–∞ –æ—Å–Ω–∞—â–∞–µ—Ç –≤–∞—Å —Å—Ç–∏–ª—å–Ω—ã–º —Å–Ω–∞—Ä—è–∂–µ–Ω–∏–µ–º –¥–ª—è –ø–æ–¥–≤–æ–¥–Ω—ã—Ö –∏—Å—Å–ª–µ–¥–æ–≤–∞–Ω–∏–π –∏ —Ç—Ä—É–±–∫–æ–π ‚Äî –∏–¥–µ–∞–ª—å–Ω–æ –¥–ª—è –≤–∏—Ä—Ç—É–∞–ª—å–Ω—ã—Ö –ø–æ–¥–≤–æ–¥–Ω—ã—Ö –º–∏—Ä–æ–≤.',
  'shop.win-anim-dance-title': '–¢–∞–Ω–µ—Ü –ø–æ–±–µ–¥—ã',
  'shop.win-anim-dance-description': '–í—ã—Ä–∞–∑–∏—Ç–µ —Å–≤–æ—é –ø–æ–±–µ–¥—É —Å –ø–æ–º–æ—â—å—é –¥–∏–Ω–∞–º–∏—á–Ω–æ–≥–æ –∏ –≤–µ—Å–µ–ª–æ–≥–æ —Ç–∞–Ω—Ü–∞, –∫–æ—Ç–æ—Ä—ã–π –æ–∂–∏–≤–∏—Ç –≤–∞—à–µ–≥–æ –ø–µ—Ä—Å–æ–Ω–∞–∂–∞. –ü–æ–∫–∞–∂–∏—Ç–µ —Å–≤–æ–π —É—Å–ø–µ—Ö –≤ –∏–≥—Ä–µ –∏ –ø–æ–∑–≤–æ–ª—å—Ç–µ —Ä–∏—Ç–º—É –ø–æ–±–µ–¥—ã –∑–∞–Ω—è—Ç—å —Ü–µ–Ω—Ç—Ä–∞–ª—å–Ω–æ–µ –º–µ—Å—Ç–æ. –ù–∞—á–∏–Ω–∞–π—Ç–µ –≤–µ—á–µ—Ä–∏–Ω–∫—É!',
  'shop.geography-awareness-bundle-title': '–ì–ª–æ–±–µ—Ç—Ä–æ—Ç—Ç–µ—Ä',
  'shop.geography-awareness-bundle-description': '–° —ç—Ç–∏–º –Ω–∞—Ä—è–¥–æ–º —Ç—ã –º–æ–∂–µ—à—å –ø—Ä–æ–¥–µ–º–æ–Ω—Å—Ç—Ä–∏—Ä–æ–≤–∞—Ç—å —Å–≤–æ—é –≥–æ—Ä–¥–æ—Å—Ç—å –∑–∞ –≥–µ–æ–≥—Ä–∞—Ñ–∏—é. üåç –ò–¥–µ–∞–ª—å–Ω–æ –¥–ª—è –∏—Å—Å–ª–µ–¥–æ–≤–∞—Ç–µ–ª–µ–π, –∫–æ—Ç–æ—Ä—ã–µ —Ö–æ—Ç—è—Ç –≤—ã–¥–µ–ª—è—Ç—å—Å—è –Ω–∞ –∫–∞—Ä—Ç–µ. –ü–æ–ª—É—á–∏ —Å–≤–æ–π –∏ –ø—Ä–∏—Å–æ–µ–¥–∏–Ω–∏—Å—å –∫ –≥–ª–æ–±–∞–ª—å–Ω–æ–º—É –ø—Ä–∞–∑–¥–Ω–∏–∫—É!',
  'shop.turkey-toppers-bundle-title': '–ì–æ–ª–æ–≤–Ω—ã–µ —É–±–æ—Ä—ã —Å –∏–Ω–¥–µ–π–∫–∞–º–∏',
  'shop.turkey-toppers-bundle-description': '–≠—Ç–æ—Ç –ø—Ä–∞–∑–¥–Ω–∏—á–Ω—ã–π –Ω–∞–±–æ—Ä –≤–∫–ª—é—á–∞–µ—Ç –¥–≤–∞ –º–∏–ª—ã—Ö –∏–Ω–¥—é—à–∞—á—å–∏—Ö —à–ª—è–ø—ã, –∏–¥–µ–∞–ª—å–Ω–æ –ø–æ–¥—Ö–æ–¥—è—â–∏—Ö –¥–ª—è –ø—Ä–∞–∑–¥–Ω–æ–≤–∞–Ω–∏—è —Å–µ–∑–æ–Ω–∞ –±–ª–∞–≥–æ–¥–∞—Ä–Ω–æ—Å—Ç–∏. –ù–∞—Ä—è–¥–∏—Ç–µ —Å–≤–æ–µ–≥–æ –ø–µ—Ä—Å–æ–Ω–∞–∂–∞ –≤ —Å—Ç–∏–ª—å, –ø–æ–∫–∞–∑—ã–≤–∞—è —Ç–µ–ø–ª–æ –∏ —Ä–∞–¥–æ—Å—Ç—å –î–Ω—è –±–ª–∞–≥–æ–¥–∞—Ä–µ–Ω–∏—è. –í–æ–ø–ª–æ—Ç–∏—Ç–µ —Ä–∞–¥–æ—Å—Ç—å –ø—Ä–∞–∑–¥–Ω–∏–∫–∞ —Å —ç—Ç–∏–º –æ—á–∞—Ä–æ–≤–∞—Ç–µ–ª—å–Ω—ã–º –∞–∫—Å–µ—Å—Å—É–∞—Ä–æ–º, —Ä–∞—Å–ø—Ä–æ—Å—Ç—Ä–∞–Ω—è—è –ø—Ä–∞–∑–¥–Ω–∏—á–Ω–æ–µ –Ω–∞—Å—Ç—Ä–æ–µ–Ω–∏–µ –Ω–∞ –∫–∞–∂–¥–æ–π –≤–∏—Ä—Ç—É–∞–ª—å–Ω–æ–π –≤—Å—Ç—Ä–µ—á–µ.',
  'shop.fungi-fun-bundle-title': '–ì—Ä–∏–±–Ω–æ–µ –≤–µ—Å–µ–ª—å–µ',
  'shop.fungi-fun-bundle-description': '–ü—Ä–∞–∑–¥–Ω—É–π—Ç–µ —Å–æ–æ–±—â–µ—Å—Ç–≤–æ GeoGuessr, –∫–æ—Ç–æ—Ä–æ–µ —Ç–∞–∫ –∂–µ —Å–ª–æ–∂–Ω–æ —Å–≤—è–∑–∞–Ω–æ, –∫–∞–∫ —Å–µ—Ç—å –º–∏—Ü–µ–ª–∏—è! üçÑ –ö–∞–∂–¥—ã–π –∏–≥—Ä–æ–∫, –∫–∞–∫ —Å–ø–æ—Ä–∞, —Ä–∞—Å–ø—Ä–æ—Å—Ç—Ä–∞–Ω—è–µ—Ç –∑–Ω–∞–Ω–∏—è –∏ —Ä–∞–¥–æ—Å—Ç—å, —Å–æ–∑–¥–∞–≤–∞—è –ø—Ä–æ—Ü–≤–µ—Ç–∞—é—â—É—é —ç–∫–æ—Å–∏—Å—Ç–µ–º—É –ª—é–±–∏—Ç–µ–ª–µ–π –≥–µ–æ–≥—Ä–∞—Ñ–∏–∏. üåê –í–ø–µ—Ä–µ–¥, –≤ —à–ª—è–ø–µ –≥—Ä–∏–±–∞!',
  'shop.emotes-animation-bundle-description': '–û—Ç–∫—Ä–æ–π—Ç–µ –¥–ª—è —Å–µ–±—è –º–∏—Ä —ç–º–æ—Ü–∏–π —Å –Ω–∞—à–∏–º –Ω–∞–±–æ—Ä–æ–º –∞–Ω–∏–º–∏—Ä–æ–≤–∞–Ω–Ω—ã—Ö —ç–º–æ–¥–∑–∏! –í—ã—Ä–∞–∂–∞–π—Ç–µ —Å–µ–±—è –≤ –∏–≥—Ä–µ —Å –ø–æ–º–æ—â—å—é –¥–∏–Ω–∞–º–∏—á–Ω—ã—Ö —ç–º–æ–¥–∑–∏, —Ç–∞–∫–∏—Ö –∫–∞–∫ –í–∑–æ—Ä–≤–∞–≤—à–∞—è—Å—è –≥–æ–ª–æ–≤–∞, –•–æ—Ä–æ—à–∞—è –∏–≥—Ä–∞, –†–∞–∑–¥—Ä–∞–∂–µ–Ω–Ω—ã–π, –û–∑–∞–¥–∞—á–µ–Ω–Ω—ã–π, –í–æ–ª–Ω—É—é—â–∏–π—Å—è –∏ –°—á–∞—Å—Ç–ª–∏–≤—ã–π. –ü–æ–¥–Ω–∏–º–∏—Ç–µ –≤–∑–∞–∏–º–æ–¥–µ–π—Å—Ç–≤–∏–µ –Ω–∞ –Ω–æ–≤—ã–π —É—Ä–æ–≤–µ–Ω—å –∏ –ø–æ–∑–≤–æ–ª—å—Ç–µ —ç–º–æ—Ü–∏—è–º —Ä–∞–∑–≥—É–ª—è—Ç—å—Å—è!',
  'shop.emotes-animation-bundle-title': '–í—ã—Ä–∞–∑–∏—Ç–µ —Å–µ–±—è',
  'shop.win-anim-raise-title': '–ü–æ–¥–Ω–∏–º–∏—Ç–µ –∫—Ä—ã—à—É',
