  'shop.xmas-one-bundle-title': '–Å–ª–æ—á–Ω–æ–µ –Ω–∞—Å—Ç—Ä–æ–µ–Ω–∏–µ',
  'shop.xmas-one-bundle-description': '–ù–∞—Å—Ç—Ä–æ–∏—Ç–µ—Å—å –Ω–∞ –ø—Ä–∞–∑–¥–Ω–∏–∫ –∏ –ø—Ä–æ–¥–µ–º–æ–Ω—Å—Ç—Ä–∏—Ä—É–π—Ç–µ —Å–≤–æ–π –Ω–æ–≤–æ–≥–æ–¥–Ω–∏–π –¥—É—Ö —Å –Ω–∞—à–∏–º —Ä–æ–∂–¥–µ—Å—Ç–≤–µ–Ω—Å–∫–∏–º –Ω–∞–±–æ—Ä–æ–º! –í—ã–¥–µ–ª—è–π—Ç–µ—Å—å –≤ –∏–≥—Ä–æ–≤–æ–º –º–∏—Ä–µ —Å —ç—Ç–∏–º–∏ –≤–µ—Å–µ–ª—ã–º–∏ –¥–æ–ø–æ–ª–Ω–µ–Ω–∏—è–º–∏. –í—Ä–µ–º—è –∏–≥—Ä–∞—Ç—å, –ø–æ–±–µ–∂–¥–∞—Ç—å –∏ —Ä–∞—Å–ø—Ä–æ—Å—Ç—Ä–∞–Ω—è—Ç—å —Ä–∞–¥–æ—Å—Ç—å –≤ —Å—Ç–∏–ª–µ!',
  'shop.daigo-creator-bundle-description': '–ò–∑—É—á–∞–π—Ç–µ –º–∏—Ä —Å Daig_O, –∑–Ω–∞–º–µ–Ω–∏—Ç—ã–º –∏–≥—Ä–æ–∫–æ–º GeoGuessr –∏–∑ –Ø–ø–æ–Ω–∏–∏. –ï–≥–æ —É–Ω–∏–∫–∞–ª—å–Ω–∞—è –∏–∫–æ–Ω–∫–∞ —Å –ø–∏–Ω–≥–≤–∏–Ω–æ–º –æ—Ç—Ä–∞–∂–∞–µ—Ç –µ–≥–æ –∏–≥—Ä–∏–≤—ã–π –ø–æ–¥—Ö–æ–¥ –∏ –Ω–µ—É–∫–æ—Å–Ω–∏—Ç–µ–ª—å–Ω–æ–µ —Å—Ç—Ä–µ–º–ª–µ–Ω–∏–µ –ø–æ–ø—É–ª—è—Ä–∏–∑–∏—Ä–æ–≤–∞—Ç—å GeoGuessr.',
