  'shop.xmas-two-bundle-title': '–ü—Ä–∞–∑–¥–Ω–∏—á–Ω—ã–µ —à–ª—è–ø—ã',
  'shop.xmas-two-bundle-description': '–£–¥–≤–æ–∏—Ç–µ –ø—Ä–∞–∑–¥–Ω–∏—á–Ω–æ–µ –≤–µ—Å–µ–ª—å–µ —Å –∫–æ–º–±–∏–Ω–∞—Ü–∏–µ–π –±—É–º–∞–∂–Ω–æ–≥–æ —Ö–ª–æ–ø—É—à–∫–∏ –∏ —à–ª—è–ø—ã –°–∞–Ω—Ç—ã! –ù–∞—Ä—è–¥–∏—Ç–µ —Å–≤–æ–µ–≥–æ –ø–µ—Ä—Å–æ–Ω–∞–∂–∞ –≤ –Ω–æ–≤–æ–≥–æ–¥–Ω–µ–µ –Ω–∞—Å—Ç—Ä–æ–µ–Ω–∏–µ, —Å–æ—á–µ—Ç–∞—è –∑–∞–±–∞–≤–Ω—ã–µ –ø—Ä–∞–∑–¥–Ω–∏—á–Ω—ã–µ —Ö–ª–æ–ø—É—à–∫–∏ —Å –∫–ª–∞—Å—Å–∏—á–µ—Å–∫–æ–π —à–ª—è–ø–æ–π –°–∞–Ω—Ç–∞-–ö–ª–∞—É—Å–∞. –†–∞—Å–ø—Ä–æ—Å—Ç—Ä–∞–Ω—è–π—Ç–µ —Ä–∞–¥–æ—Å—Ç—å –∏ –≤–µ—Å–µ–ª—å–µ –ø–æ –≤—Å–µ–º—É –≤–∏—Ä—Ç—É–∞–ª—å–Ω–æ–º—É –º–∏—Ä—É.',
  'shop.new-years-2024-bundle-title': '–ù–æ–≤—ã–π –≥–æ–¥ –≤ —ç–ª–µ–≥–∞–Ω—Ç–Ω–æ—Å—Ç–∏',
  'shop.new-years-2024-bundle-description': '–í—Å—Ç—Ä–µ—Ç—å—Ç–µ –Ω–æ–≤—ã–π –≥–æ–¥ —Å —Å—Ç–∏–ª–µ–º! –ù–∞—à —ç–∫—Å–∫–ª—é–∑–∏–≤–Ω—ã–π –Ω–∞–±–æ—Ä –∞–≤–∞—Ç–∞—Ä–æ–≤ –≤–∫–ª—é—á–∞–µ—Ç —à–∏–∫–∞—Ä–Ω—ã–µ –Ω–æ–≤–æ–≥–æ–¥–Ω–∏–µ —à–ª—è–ø—ã –∏ –∑–∞–±–∞–≤–Ω—É—é –º–∞—Å–∫—É, –ø—Ä–∏–¥–∞–≤–∞—è –≤–∞—à–µ–º—É –≤–∏—Ä—Ç—É–∞–ª—å–Ω–æ–º—É –ø—Ä–∏—Å—É—Ç—Å—Ç–≤–∏—é —à–∞—Ä–º. –ó–∞ –∑–¥–æ—Ä–æ–≤—å–µ –∏ —ç–ª–µ–≥–∞–Ω—Ç–Ω—ã–π –ø—É—Ç—å –≤–ø–µ—Ä–µ–¥.',
